window.bookSummaryJSON = "<p>Grandfather tried to prepare me for everything…</p> <p>Yet, how could anyone prepare me for this?</p> <p>Kidnapping.</p> <p>Blackmail.</p> <p>Deception.</p> <p>Grief.</p> <p>Vengeance.</p> <p>The Royals have always been about blood. Blood lines, blood relations, and the spilling of blood. I didn’t ask for this war. I didn’t go looking for it.</p> <p>But I will let nothing and no one keep me from the men I love and we will find what was taken from us. No one will ever steal from us again.</p> <p>They say desperation makes for strange bedfellows, fortunately, the men in my bed are far more dangerous to everyone else.</p> <p>It’s time for a change in leadership, one way or another, the Bay Ridge Royals are going down in flames. Once it’s all ashes—then we can rebuild.</p> <p>DESPERATE VICTORY is a full-length mature dark, new adult romance with enemies-to-lovers/love-hate themes. Please be aware some situations may be uncomfortable for listeners. Trigger warnings can be found in the foreword should you require them. This is book six in a six book series that is a why choose with multiple new adults exploring and coming to terms with their evolving sexuality, identities, and relationships. Release date may be moved up.</p>"; 
